import Dog from "../models/dog";

type Props = {
    url: string,
    id: string
};

export default function Card({ url }: Props) {
    return (
        <div>
            <div
                className="book-cover"
                style={{
                    width: 400,
                    height: 300,
                    marginBottom: '5px',
                    backgroundSize: 'cover',
                    backgroundImage: `url(${url})`,
                }}
            ></div>
            <button>See More</button>
        </div>
    )
}
